 "shadowVerticalLength": 2,
 "scrollBarColor": "#000000",
 "backgroundColorDirection": "vertical",
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>OPEN STAGE</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Open Stage di Museum Pustaka Lontar merupakan area yang dirancang sebagai ruang terbuka untuk berbagai kegiatan budaya dan edukasi. Tempat ini berfungsi sebagai panggung utama dalam penyelenggaraan berbagai acara, seperti Bulan Bahasa Bali, pertunjukan seni, diskusi budaya, dan kegiatan lainnya yang mendukung pelestarian warisan lontar. Dengan desain yang terbuka dan fleksibel, Open Stage mampu menampung banyak peserta, menjadikannya lokasi ideal untuk berbagai aktivitas interaktif. Keberadaan tempat ini tidak hanya menambah daya tarik museum, tetapi juga memberikan ruang bagi masyarakat untuk berpartisipasi dalam upaya melestarikan budaya dan sastra Bali secara lebih dinamis.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
