 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>MUSEUM PUSTAKA LONTAR</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:22px;font-family:Georgia, serif;\"><B>Desa Adat Dukuh Penaban Kab. Karangasem Provinsi Bali</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:19px;font-family:'Book Antiqua';\">Museum Pustaka Lontar diresmikan pada 11 April 2017 di Desa Adat Dukuh Penaban, Kelurahan Karangasem, Bali. Museum Pustaka Lontar didirikan sebagai upaya melestarikan lontar. Lontar merupakan sebuah medium tulis tradisional yang terbuat dari daun tal. Lontar menyimpan nilai budaya dan pengetahuan Bali, termasuk naskah agama, sejarah, politik, pengobatan, dan kearifan lokal. Berawal dari kesadaran masyarakat Desa Adat Dukuh Penaban terhadap kondisi lontar yang banyak dimiliki oleh masyarakat di Desa Adat Dukuh Penaban yang tidak terawat, museum ini dibangun secara gotong royong di atas lahan desa seluas 1,5 hektar. Bangunan utamanya, Bale Sangkul Putih, memiliki fungsi sebagai pusat edukasi, konservasi, dan pelatihan lontar. Selain itu, museum ini menjadi tempat wisata edukasi dan ruang pertemuan, dengan fasilitas seperti Bale Asta Brata untuk diskusi dan PAUD berbasis Hindu, serta Wantilan Singarsa Gosana untuk memamerkan koleksi lontar. Museum Pustaka Lontar kini menjadi pusat pelestarian warisan budaya Bali sekaligus sarana edukasi bagi generasi mendatang.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
