 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE SANGKUL PUTIH</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:22px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"><B>Bale Sangkul Putih</B></SPAN><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"> adalah salah satu bangunan utama di Museum Pustaka Lontar, Desa Adat Dukuh Penaban, Kelurahan Karangasem, Bali. Bangunan ini didirikan dengan tujuan untuk mendukung upaya pelestarian, edukasi, dan konservasi lontar, yang merupakan medium tulis tradisional khas Bali. Nama \"Sangkul Putih\" diambil dari lontar kepemangkuan Puja Sang Kul Putih, yang mencerminkan nilai-nilai spiritual dan kearifan lokal Bali. Bale Sangkul Putih memiliki tiga bagian utama yaitu:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Book Antiqua';\"> \u2022 </SPAN><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"><B>Bale Daja</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Book Antiqua';\"> \u2022 </SPAN><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"><B>Bale Pasraman</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Book Antiqua';\"> \u2022 </SPAN><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"><B>Pewaregan</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\"><B>Bale Sangkul Putih </B></SPAN><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Book Antiqua';\">tidak hanya menjadi tempat pelestarian fisik lontar tetapi juga pusat penyebaran ilmu pengetahuan dan nilai budaya. Bangunan ini memainkan peran penting dalam memastikan tradisi Bali tetap hidup, menjadi sumber edukasi, dan mendukung pariwisata budaya yang berbasis konservasi warisan leluhur.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
