 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE PANJANG</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Panjang</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> is one of the buildings in Museum Pustaka Lontar. This building functions to support various educational, cultural, and social activities at Museum Pustaka Lontar. Bale Panjang is often used to hold meetings, seminars, workshops, gatherings, and various other events involving the local community and visitors. Bale Panjang not only functions as a gathering place, but also as a means to strengthen social interaction and collaboration between visitors, the community, and museum managers. Events held here often aim to introduce Balinese culture, including the lontar tradition, to the younger generation and tourists.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;\"> </SPAN></SPAN></DIV></div>",
