 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE ASTA BRATA</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Asta Brata</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> merupakan salah satu bangunan yang ada di Museum Pustaka Lontar yang memiliki fungsi sebagai ruang pertemuan dan edukasi. Tempat ini awalnya dirancang untuk menjadi lokasi rapat para prajuru, di mana lontar Asta Brata\u2014sebuah naskah yang menguraikan prinsip-prinsip kepemimpinan Hindu\u2014diperkenalkan dan dibahas. Lontar ini menjadi panduan bagi pemimpin untuk menjalankan tugasnya dengan bijaksana, mengacu pada delapan sifat luhur yang diambil dari alam semesta.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Saat ini, </SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Asta Brata </B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">juga dimanfaatkan sebagai sekolah PAUD berbasis Hindu. Dengan mengintegrasikan nilai-nilai luhur dari lontar Asta Brata ke dalam pendidikan anak usia dini, tempat ini menjadi wadah pembelajaran yang tidak hanya berfokus pada aspek akademis, tetapi juga membangun karakter dan moral berdasarkan ajaran Hindu.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
