 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE PASRAMAN</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:22px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Pasraman</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> adalah salah satu bagian penting dari Bale Sangkul Putih pada Museum Pustaka Lontar, Desa Adat Dukuh Penaban, Karangasem, Bali. Bale Pasraman ini dirancang sebagai ruang edukasi dan pelatihan yang berfokus pada pelestarian lontar dan pengajaran tradisi budaya Bali. </SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Fungsi utama Bale Pasraman</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> adalah memberikan pembelajaran tentang berbagai aspek lontar kepada masyarakat dan pengunjung. Di tempat ini, pengunjung dapat belajar menulis lontar dengan aksara Bali menggunakan teknik tradisional, memahami proses pembuatan lontar mulai dari pengolahan daun tal hingga menjadi medium tulis yang siap digunakan, serta mempelajari cara merawat dan melestarikan lontar agar tetap terjaga keasliannya. Selain itu, Bale Pasraman juga digunakan untuk mengenalkan berbagai nilai filosofis dan kearifan lokal yang tertulis dalam lontar.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Selain fungsi edukatif, Bale Pasraman menjadi daya tarik wisata budaya. Pengunjung, baik lokal maupun mancanegara, dapat berinteraksi langsung dengan warisan tradisional Bali, memperkaya pemahaman mereka tentang sejarah dan budaya yang tertuang dalam lontar. Dengan demikian, Bale Pasraman tidak hanya berfungsi sebagai tempat pelestarian warisan budaya, tetapi juga sebagai sarana untuk memperkenalkan nilai-nilai tradisional Bali kepada generasi mendatang dan masyarakat global.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
