 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE PASRAMAN</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Pasraman</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> is one of the important parts of Bale Sangkul Putih at Museum Pustaka Lontar, in the traditional village of Dukuh Penaban, Karangasem, Bali. Bale Pasraman is designed as an education and training space that focuses on lontar preservation and teaching Balinese cultural traditions. </SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>The main function</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> of the bale pasraman is to provide learning about various aspects of lontar to the community and visitors. In this place, visitors can learn to write lontar with Balinese script using traditional techniques, understand the process of making lontar from processing tal leaves into a ready-to-use writing medium, and learn how to care for and preserve lontar to maintain its authenticity. In addition, bale pasraman is also used to introduce various philosophical values and local wisdom written in lontar. In addition to its educational function, the bale pasraman is a cultural tourism attraction. Visitors, both local and foreign, can interact directly with traditional Balinese heritage, enriching their understanding of the history and culture inscribed in lontar. Therefore, bale pasraman not only functions as a place for preserving cultural heritage, but also as a means of introducing traditional Balinese values to future generations and the global community. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
