 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>BALE DAJA</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Daja</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> adalah salah satu bangunan utama yang ada di dalam Bale Sangkul Putih pada Museum Pustaka Lontar. Bale Daja berfungsi sebagai tempat penyimpanan lontar lontar yang menjadikannya ruang yang penting dalam upaya pelestarian warisan budaya bali. </SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Sebagai tempat penyimpanan lontar, Bale Daja dirancang untuk memastikan lontar \u2013 lontar tetap terlindungi dari kerusakan akibat usia, cuaca maupun perlakuan yang kurang tepat. Koleksi lontar yang disimpan di Bale Daja mencakup berbagai jenis Lontar Usada, Lontar Geguritan, Lontar Kawisesa, Lontar Bebantenan, Lontar Babad, dan Lontar Asta Kosala-Kosali.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Bale Daja</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> tidak hanya berperan sebagai ruang penyimpanan, tetapi juga sebagai sumber informasi dan pengetahuan. Koleksi lontar yang ada di sini dapat diakses untuk penelitian, edukasi, dan pelatihan, baik oleh masyarakat lokal maupun pengunjung. Untuk memastikan keamanan dan keaslian lontar, pengelolaan di Bale Daja dilakukan secara hati-hati dengan melibatkan ahli pelestarian lontar.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
