 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>WANTILAN SINGARSA GOSANA</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Wantilan Singarsa Gosana </B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">adalah salah satu bangunan yang ada di Museum Pustaka Lontar yang berfungsi sebagai ruang pameran untuk menampilkan koleksi lontar dan prasi. Tempat ini dirancang untuk memberikan pengalaman edukatif kepada pengunjung dengan menghadirkan berbagai naskah lontar kuno dan karya prasi, yaitu seni ukiran tradisional Bali pada daun lontar.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Sebagai pusat untuk pameran, </SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Wantilan Singarsa Gosana</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> tidak hanya memperlihatkan keindahan karya budaya, tetapi juga menjadi media untuk mengenalkan kekayaan literasi tradisional Bali yang sarat akan nilai sejarah, spiritualitas, dan seni. Koleksi yang dipamerkan mencerminkan kearifan lokal serta keberagaman pengetahuan yang tertuang dalam lontar dan prasi, menjadikannya daya tarik utama bagi wisatawan, peneliti, maupun pecinta budaya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
