 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>WANTILAN SINGARSA GOSANA</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Wantilan Singarsa Gosana</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> is one of the buildings in Museum Pustaka Lontar that serves as an exhibition space to display the lontar and prasi collections. It is designed to provide an educational experience to visitors by presenting a variety of ancient lontar manuscripts and prasi works, the traditional Balinese art of carving on lontar leaves.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">As a center for exhibitions, </SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Wantilan Singarsa Gosana</B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"> not only showcases the beauty of cultural works, but also serves as a medium to introduce the wealth of traditional Balinese literacy that is full of historical, spiritual and artistic values. The collection on display reflects the local wisdom and diversity of knowledge contained in lontar and prasi, making it a major attraction for tourists, researchers, and culture lovers.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
