 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;\"><B>AREA OUTBOUND</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Museum Pustaka Lontar tidak hanya menjadi pusat pelestarian budaya dan literasi tradisional, tetapi juga menyediakan fasilitas rekreasi berupa area outbound. Area ini dirancang untuk memberikan pengalaman berlibur yang menyenangkan, edukatif, sekaligus mendukung kegiatan sosial dan kebersamaan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Rekreasi dan Aktivitas Outdoor</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Dengan suasana asri dan udara segar khas pedesaan Bali, area outbound di Museum Pustaka Lontar menjadi tempat ideal untuk melepas penat dari rutinitas sehari-hari. Berbagai aktivitas rekreasi dapat dilakukan di sini, seperti permainan kelompok, jalan santai di sekitar area hijau, hingga menikmati pemandangan alam yang memukau.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Lokasi untuk Berbagai Acara dan Event</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Area outbound ini juga dapat digunakan untuk berbagai acara, seperti reuni keluarga, pertemuan komunitas, hingga kegiatan kemah bersama. Dengan ruang terbuka yang luas, fasilitas ini sangat mendukung pelaksanaan acara dalam skala kecil maupun besar. Pihak museum juga menyediakan dukungan logistik untuk kebutuhan acara, seperti penyewaan perlengkapan tenda, panggung, dan kebutuhan teknis lainnya.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\"><B>Kegiatan Kemah dan Pelatihan</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">Bagi pecinta alam dan petualangan, area outbound ini sangat cocok untuk kegiatan kemah. Dengan lingkungan yang aman dan fasilitas yang memadai, peserta dapat menikmati malam di alam terbuka sambil berinteraksi dengan keindahan alam sekitar. Selain itu, area ini sering digunakan untuk pelatihan berbasis tim seperti team building, leadership camp, dan outbound edukatif.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
