 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;\"><B>PEWAREGAN</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Times New Roman', Times, serif;\"><B>Pewaregan </B></SPAN><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Times New Roman', Times, serif;\">adalah salah satu bagian penting dari Bale Sangkul Putih pada Museum Pustaka Lontar. Pewaregan berfungsi sebagai tempat untuk memproses daun tal, yang merupakan bahan utama dalam pembuatan lontar. Proses ini melibatkan beberapa tahapan penting untuk mengubah daun tal mentah menjadi medium tulis tradisional yang siap digunakan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Times New Roman', Times, serif;\">Di Pewaregan, daun tal diperlakukan dengan teknik khusus untuk memastikan ketahanannya sebagai medium tulis. Proses dimulai dengan memilih daun tal yang berkualitas, kemudian daun-daun tersebut direbus untuk menghilangkan getahnya dan memperkuat seratnya. Setelah direbus, daun dikeringkan dengan cara tertentu agar tidak mudah rapuh atau rusak. Hasil akhirnya adalah lembaran daun tal yang halus, siap untuk ditulis dengan aksara Bali menggunakan pisau khusus.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:20px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
